// client/src/pages/admin/AdminDashboard.jsx
import React, { useState, useEffect } from "react";
import axios from "axios";
import AdminNavbar from "../../components/AdminNavbar";
import Loader from "../../components/Loader";

const AdminDashboard = () => {
  const [stats, setStats] = useState({
    totalCourses: 0,
    totalLectures: 0,
    totalInstructors: 0,
  });

  const [courses, setCourses] = useState([]);
  const [lectures, setLectures] = useState([]);
  const [loading, setLoading] = useState(true);

  // Fetch dashboard stats, courses, and lectures
  useEffect(() => {
    const fetchData = async () => {
      try {
        const [statsRes, coursesRes, lecturesRes] = await Promise.all([
          axios.get("http://localhost:5000/api/admin/dashboard"),
          axios.get("http://localhost:5000/api/admin/courses"),
          axios.get("http://localhost:5000/api/admin/lectures"),
        ]);

        setStats(statsRes.data);
        setCourses(coursesRes.data);
        setLectures(lecturesRes.data);
      } catch (err) {
        console.error("Error fetching dashboard data:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) return <Loader />;

  return (
    <div>
      <AdminNavbar />
      <div className="container">
        <h2>Admin Dashboard</h2>

        {/* Stats */}
        <div className="stats">
          <div>
            <h3>Total Courses</h3>
            <p>{stats.totalCourses}</p>
          </div>
          <div>
            <h3>Total Lectures</h3>
            <p>{stats.totalLectures}</p>
          </div>
          <div>
            <h3>Total Instructors</h3>
            <p>{stats.totalInstructors}</p>
          </div>
        </div>

        {/* Courses Table */}
        <h3>Courses</h3>
        <table border="1" cellPadding="8" cellSpacing="0">
          <thead>
            <tr>
              <th>Title</th>
              <th>Description</th>
              <th>Instructor</th>
            </tr>
          </thead>
          <tbody>
            {courses.map((course) => (
              <tr key={course._id}>
                <td>{course.title}</td>
                <td>{course.description}</td>
                <td>{course.instructor?.name || "N/A"}</td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Lectures Table */}
        <h3>Lectures</h3>
        <table border="1" cellPadding="8" cellSpacing="0">
          <thead>
            <tr>
              <th>Title</th>
              <th>Course</th>
              <th>Instructor</th>
              <th>Date</th>
              <th>Time</th>
            </tr>
          </thead>
          <tbody>
            {lectures.map((lecture) => (
              <tr key={lecture._id}>
                <td>{lecture.title}</td>
                <td>{lecture.course?.title || "N/A"}</td>
                <td>{lecture.instructor?.name || "N/A"}</td>
                <td>{lecture.date}</td>
                <td>{lecture.time}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default AdminDashboard;
